package com.juho.leetCode.challenge.y2021.month02.day11;

import static org.junit.jupiter.api.Assertions.assertEquals;
import org.junit.jupiter.api.Test;

public class ValidAnagramTest {
    
    ValidAnagram va = new ValidAnagram();

    @Test
    public void validAnagram01Test() {
        String s01 = "anagram";
        String t01 = "nagaram";
        assertEquals(va.isAnagram(s01, t01), true);

        String s02 = "rat";
        String t02 = "car";
        assertEquals(va.isAnagram(s02, t02), false);

        String s03 = "aacc";
        String t03 = "ccac";
        assertEquals(va.isAnagram(s03, t03), false);

        String s04 = "";
        String t04 = "";

        assertEquals(va.isAnagram(s04, t04), true);
    }
}
